CREATE TABLE g5_semafaro(
   id_semafaro       INTEGER  NOT NULL PRIMARY KEY 
  ,solicitacao       INTEGER  NOT NULL
  ,orgao_responsavel VARCHAR(32) NOT NULL
  ,data              DATE  NOT NULL
  ,unidade_regional  VARCHAR(33) NOT NULL
  ,estado_atual      VARCHAR(51) NOT NULL
  ,rua               VARCHAR(46) NOT NULL
  ,numero            INTEGER  NOT NULL
  ,bairro            VARCHAR(19) NOT NULL
  ,id_bairro         INTEGER  NOT NULL
  ,FOREIGN KEY (id_bairro) REFERENCES g5_bairro_cidade
);
